import axios from 'axios';
import { MoviesPerActorResponse, ActorsWithMultipleCharactersResponse, CharactersWithMultipleActorsResponse } from '../../../shared/types'

const API_URL = 'http://localhost:5000/api/actors';  // TODO Replace with env variable

export const fetchMoviesPerActor = async (): Promise<MoviesPerActorResponse> => {
  const response = await axios.get(`${API_URL}/moviesPerActor`);
  return response.data;
};

export const fetchActorsWithMultipleCharacters = async (): Promise<ActorsWithMultipleCharactersResponse> => {
  const response = await axios.get(`${API_URL}/actorsWithMultipleCharacters`);
  return response.data;
};
